import React, { Component } from 'react'


const dummy_prop = {
    title : '테스트용 타이틀',
    content : '테스트용 내용'
}


export default class Postview extends Component{
    render() {
        const {title,content} = dummy_prop
        return(
        <div>
            <h3>{title}</h3>
            <p>{content}</p>
        </div>
        )
    }
}
